  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides the public an opportunity
  to review the measures of each city department and helps to maintain open communication
  and transparency with Austin residents. It is the dataset form of the online database,
  ePerformance Measures, found on the Cityu2019s website here: http://www.austintexas.gov/budget/eperf/index.cfm.
  The City of Austin is committed to providing the highest quality services to our
  community members. As efforts to be the most livable and best managed city in the
  country continue, this dataset provides valuable information needed to sustain service
  levels, strive for excellence, and continue improvement. Performance measures provide
  departmental staff and management with the critical operating information they need
  to assess quality service delivery and measure success. Measures provide City management
  key decision-making information for resource allocation, process improvements and
  other management decisions. Measures also provide the City Council comprehensive
  data on each department's primary operating functions. Further information on some
  of the key terms utilized throughout the dataset can be accessed through the Definitions
  section of the ePerf website: http://www.austintexas.gov/budget/eperf/index.cfm?fuseaction=home.Definitions.
  The data shown in the dataset is based on the most updated information available
  and could change as more current information is provided. nnIf you have any questions
  or comments regarding this database, or any budget inquiry, please contact the Budget
  Office via email at coa.budget@austintexas.gov or telephone at (512) 974-2610.\",\n\t\"license_title\":
